    // added functions for hotspot customizations
    function selectChange(args) {
        if (args.state === "Changed") {
            let appearance = document.getElementById("propertypanel");
            let selectedElement = document.getElementsByClassName("e-remove-selection");
            if (args.newValue) {
                if (! appearance.classList.contains("e-remove-selection")) {
                    appearance.classList.add("e-remove-selection");
                }
                if (args.newValue[0] instanceof Node && selectedElement.length) {
                    selectedElement[0].classList.remove("e-remove-selection");
                    let port = getPort();
                    let portVisibilityCollection = [];
                    if (PortVisibility.Visible & port[0].visibility) {
                        portVisibilityCollection.push(PortVisibility.Visible);
                    }
                    if (PortVisibility.Hidden & port[0].visibility) {
                        portVisibilityCollection.push(PortVisibility.Hidden);
                    }
                    if (PortVisibility.Hover & port[0].visibility) {
                        portVisibilityCollection.push(PortVisibility.Hover);
                    }
                    if (PortVisibility.Connect & port[0].visibility) {
                        portVisibilityCollection.push(PortVisibility.Connect);
                    }
                    if (portVisibilityDrop.value !== null && portVisibilityDrop.value.length === 0) {
                        portVisibilityDrop.placeholder = 'Select Visibility';
                    }
                    portVisibilityDrop.value = portVisibilityCollection;
                    portVisibilityDrop.dataBind();
                    portFillDrop.value = port[0].style.fill;
                    portFillDrop.dataBind();
                    portBorderDrop.value = port[0].style.strokeColor;
                    portBorderDrop.dataBind();
                    portShapeDrop.value = port[0].shape;
                    portShapeDrop.dataBind();
                    portSizeNum.value = port[0].height;
                    portSizeNum.dataBind();
                    portWidthNum.value = port[0].style.strokeWidth;
                    portWidthNum.dataBind();
                }
            }
        }
    }
    // get the port for the selected node.
    function getPort() {
      // console.log(diagramInstance)
      if(diagramInstance!=null){
        let node = diagramInstance.selectedItems.nodes[0];
        let port;
        if (node) {
            port = node.ports;
        }
        return port;}
    }
    function get() {
        let node = diagramInstance.selectedItems.nodes[0];
        let port;
        if (node) {
            port = node.ports;
        }
        return port;
    }
    // change the Visibility of the Port.
    function portVisibilityDropOnChange(args) {
        let port = getPort();
        if (port) {
            for (let j = 0; j < port.length; j++) {
                port[j].visibility = 0;
                for (let i = 0; i < args.value.length; i++) {
                    port[j].visibility += args.value[i];
                }
                diagramInstance.dataBind();
            }
        }
    }
    // change the shape of the Port.
    function portShapeDropOnChange(args) {
        let port = getPort();
        for (let j = 0; j < port.length; j++) {
            switch (portShapeDrop.value) {
                case "X": port[j].shape = "X";
                    break;
                case "Circle": port[j].shape = "Circle";
                    break;
                case "Square": port[j].shape = "Square";
                    break;
                case "Custom": port[j].shape = "Custom";
                    port[j].pathData = "M6.805,0L13.61,10.703L0,10.703z";
                    break;
            }
            diagramInstance.dataBind();
        }
    }
    // set the appearence of the Port.
    function applyportstyle(value) {
        let port = getPort();
        for (let j = 0; j < port.length; j++) {
            if (value === "size" && portSizeNum) {
                port[j].height = portSizeNum.value;
                port[j].width = portSizeNum.value;
            } else if (value === "strokewidth" && portWidthNum) {
                port[j].style.strokeWidth = portWidthNum.value;
            }
        }
    }
